  \"2015-07-23T03:28:11.879095\",\n\t\"name\": \"a-natural-history-of-dune-and-beach-ridge-vegetation-along-the-southeastern-united-states-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The underlying question of the proposed
  research is this: Given different geomorphological histories of coastal landforms
  eolian versus marine origins, can a biotic community compositional differences be
  ascertained by vegetation analysis, and b if so, are these differences correlative
  with specific types andor periods of landform history? Thus, the first hypothesis
  to be tested is whether or not vegetation of coastal dunes differs from that of
  \ beach ridges. The second hypothesis to be tested is that woody species which later
  become dominant on older beach ridges and dunes are present in younger systems i.
  e. Eglers Initial Floristic Composition. In addition to these two objectives, a
  thorough examination of botanical literature, which characteristically, has erred
  in assuming that all coastal landforms above mean high tide level are dunes, and
  hence, of eolian origin, will result in needed clarification.\",\n\t\"license_title\":
